import Card from "@mui/material/Card";

function Projects(){
    const styles = theme => ({
        Card: {
          width: 300,
          margin: 'auto'
        },
        Media: {
          height: 550,
          width: '100%',
          objectFit: 'cover'
        }
      });

    return (
        <section id='projects'>
            <Container maxWidth="md">
                <Grid container spacing={3}>
                    { projects.map((project) => (
